import React, { useState } from "react";

const AboutUs = () => {
  const [showDetails, setShowDetails] = useState(false);

  const handleDetailsToggle = () => {
    setShowDetails(!showDetails);
  };

  return (
    <div
      className="section is-fullheight"
      style={{
        backgroundColor: "#eef2f3",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        minHeight: "100vh",
      }}
    >
      {/* Main Content Section */}
      <div
        className="hero-body columns is-vcentered"
        style={{
          maxWidth: "1200px",
          width: "100%",
          padding: "20px",
          margin: "0 auto",
        }}
      >
        {/* Left Section - Text Content */}
        <div className="column is-6">
          <div className="container">
            <h1
              className="title"
              style={{
                fontSize: "3rem",
                color: "#333",
                lineHeight: "1.5",
                cursor: "pointer",
              }}
              onMouseOver={(e) =>
                (e.target.style.color = "#007bff")
              } // Hover effect
              onMouseOut={(e) => (e.target.style.color = "#333")}
            >
              Wonder what/why we are? üòé
            </h1>
            <h2
              className="subtitle has-text-weight-semibold"
              style={{
                fontSize: "1.25rem",
                color: "#555",
                marginTop: "20px",
              }}
            >
              <ul
                style={{
                  listStyleType: "none",
                  paddingLeft: "0",
                  marginTop: "20px",
                }}
              >
                <li
                  style={{
                    display: "flex",
                    alignItems: "center",
                    marginBottom: "10px",
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  üè¢ Scodex is a product of SCI (Student Code In).
                </li>
                <li
                  style={{
                    display: "flex",
                    alignItems: "center",
                    marginBottom: "10px",
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  üéì We aim to provide information about Campus Ambassador
                  programs, Scholarships, and Job Opportunities.
                </li>
                <li
                  style={{
                    display: "flex",
                    alignItems: "center",
                    marginBottom: "10px",
                    transition: "transform 0.3s ease",
                    cursor: "pointer",
                  }}
                  onMouseOver={(e) =>
                    (e.target.style.transform = "scale(1.05)")
                  }
                  onMouseOut={(e) =>
                    (e.target.style.transform = "scale(1)")
                  }
                >
                  üåü Empower learners to connect with amazing people and
                  opportunities in the industry.
                </li>
              </ul>
            </h2>
            <button
              className="button is-primary"
              style={{
                marginTop: "20px",
              }}
              onClick={handleDetailsToggle}
            >
              {showDetails ? "Hide Details" : "Learn More"}
            </button>
          </div>
        </div>

        {/* Right Section - Image */}
        <div className="column is-6">
          <center>
            <a
              href="https://scodein.tech/"
              target="_blank"
              rel="noopener noreferrer"
            >
              <img
                src="https://i.ibb.co/2qK1ZSc/intro.png"
                alt="student mantra"
                style={{
                  borderRadius: "15px",
                  width: "90%",
                  maxWidth: "500px",
                  transition: "transform 0.3s ease",
                  cursor: "pointer",
                }}
                onMouseOver={(e) =>
                  (e.target.style.transform = "scale(1.1)")
                }
                onMouseOut={(e) =>
                  (e.target.style.transform = "scale(1)")
                }
              />
            </a>
          </center>
        </div>
      </div>

      {/* Additional Information */}
      {showDetails && (
        <div
          className="box"
          style={{
            backgroundColor: "#fff",
            padding: "20px",
            borderRadius: "10px",
            marginTop: "30px",
            transition: "opacity 0.5s ease",
            width: "80%",
            maxWidth: "800px",
            textAlign: "center",
          }}
        >
          <p>
            <b>
              Explore more to find dedicated sections for everything you need.
              Let's connect you to a world of opportunities! üöÄ
            </b>
          </p>
        </div>
      )}
    </div>
  );
};

export default AboutUs;
